import React, { useEffect, useState } from 'react';

const VendorProducts = ({ vendor }) => {
  const [products, setProducts] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchVendorProducts = async () => {
      try {
        if (!vendor || !vendor._id) {
          console.error("Vendor ID is missing.");
          return;
        }

        const response = await fetch(`/api/products/vendor/${vendor._id}/products`);
        const data = await response.json();

        if (data.success) {
          console.log("Fetched products data:", data.data.products); // Log fetched products data
          setProducts(data.data.products);
        } else {
          setError("Failed to load products");
        }
      } catch (error) {
        setError(error.message);
      }
    };

    if (vendor && vendor._id) {
      fetchVendorProducts();
    }
  }, [vendor]);

  if (!vendor || !vendor._id) return <div>Loading vendor products...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      <h2>Products for {vendor.dispensaryName}</h2>
      {products.length === 0 ? (
        <p>No products available</p>
      ) : (
        <ul>
          {products.map((product) => (
            <li key={product.productId}>
              <img src={product.primaryImage} alt={product.name} style={{ width: '100px' }} />
              <div>{product.name}</div>
              <div>Category: {product.category}</div>
              <div>Price: ${product.price}</div>
              <div>THC Content: {product.thcContent}mg</div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default VendorProducts;
